import LOBBY from '../constants/lobby.types';

const initialState = {

}

export function lobbyReducer (state = initialState, action) {
  switch (action.type) {
    case LOBBY.ADD_ROOM:
      break;
    case LOBBY.REMOVE_ROOM:
      break;
    case LOBBY.UPDATE:
      break;
    case LOBBY.TOGGLE_SCROLL:
      break;
    default:
      break;
  }
}
